#include <assert.h>
void Find_Rectengle(){
	for(int r = 0; r < i; r++){
		if(temp[r].X_START == -5000 && temp[r].X_END == -5000 && temp[r].Y_START == -5000 && temp[r].Y_END == -5000) continue;
		for(int num = r + 1; num < i; num++){
			if(temp[num].X_START == temp[r].X_START && temp[num].X_END == temp[r].X_END && temp[num].Y_START == temp[r].Y_END + 1){
				temp[r].Y_END++;
				temp[num].X_START = -5000;
				temp[num].X_END = -5000;
				temp[num].Y_START = -5000;
				temp[num].Y_END = -5000;
			}
		}
	}
}

